Defendant in custody.   
Defendant is before the Court for sentencing, his probation having been revoked effective 02-11-20.    
Defendant is sentenced to the Wisconsin State Prison System for a total sentence of five (5) years, two (2) years initial confinement, followed by three (3) years extended supervision.   Conditions of extended supervision are:  
1) Assessment /treatment/counseling as deemed appropriate by the Department's assessment process; 
2) AODA assessment and follow through; 
3) Maintain absolute sobriety; 
4) Obtain mental health assessment and follow through; 
5) Maintain full-time employment/job search combination.   
Court finds the defendant is eligible for the Substance Abuse Program and the Challenge Incarceration Program.   
Defendant is given credit for 529 days already served.   
Minutes.

Sentence is withheld.   Defendant is placed on probation to DOC for five (5) years.   Conditions of probation are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
2) Maintain absolute sobriety; 
3) Maintain full-time employment/schooling combination; 
4) Reimburse Metro Drug Unit $185.00 buy money; 
5) Pay supervision fees in an amount to be determined by DOC;
6) Pay costs of action; 
7) Spend ten (10) months in jail, under the Huber Law, to commence by 6:00 p.m. today;
8) Obtain GED/HSED;
9) Submit to random urine screens and pay for same.  
Defendant is entitled to 28 days sentence credit.   
